  Zene, tánc, kultúra, közösség, buli 💙


  A Bachata Dominicana Budapest szervezésében ismét lehetőségetek lesz megismerkedni a tradicionális dominikai bachata zenékkel, lépésekkel és hangulattal, egy szuper közösségben. Különleges vendégeink, külföldön elismert bachata oktatók társaságában!


